	Gizeh.notify:SetSize( 50+tw, 50 )
	Gizeh.notify:SetPos(-ScrW()-(Gizeh.notify:GetWide()/2), 35 )
	Gizeh.notify.Paint = function(self, w, h)
	  surface.SetDrawColor( Color(40,40,40) )
		surface.DrawRect( 0, 0, w, h )
	  Gizeh.OutlinedBox( 0, 0, w, h, 3, Gizeh.CheckforRainbow() )
