function Gizeh.ToConfigFile(tconfig)
  local str = "/GIZEH CONFIG/\n"
  for k,v in pairs(tconfig) do
	if string.Right(k,6) ~= "Colors" then
	  str = string.format(str.."%s=%s\n", k, v)
	end
  end
  return str.."/GIZEH CONFIG/"
end
function Gizeh.SaveConfig()
  local config = Gizeh.ToConfigFile(Gizeh.Config)
  Gizeh.New_FileWrite("GM_Config.txt", config)
end
function Gizeh.ChargerConfig()
  if Gizeh.New_FileExists("GM_Config.txt", "DATA") then
	local cfg = Gizeh.New_FileRead("GM_Config.txt")
	cfg = string.Replace(cfg, "/GIZEH CONFIG/\n", "")
	cfg = string.Replace(cfg, "/GIZEH CONFIG/", "")
	for k,v in pairs(string.Split(cfg,"\n")) do
	  if k == #string.Split(cfg,"\n") then continue end
	  local panel = string.Split(v,"=")[1]
	  local option = string.Split(v,"=")[2]
	  if string.Right(panel,10) == "ColorsTemp" then
		panel = panel:gsub("Temp", "")
		option = string.Split(option," ")
		Gizeh.Config[panel] = Color(tonumber(option[1]),tonumber(option[2]),tonumber(option[3]))
	  elseif string.Right(panel,3) == "Key" then
		Gizeh.Config[panel] = tonumber(option)
	  elseif string.Right(panel,4) == "Bool" then
		Gizeh.Config[panel] = tobool(option)
	  end
	end
  end
end
