						net.WriteString(LocalPlayer():Nick())
					else
						net.WriteString(ChosenName)
					end
					net.WriteUInt(TeamNum, 16)
					net.SendToServer()
					base:Close()
					net.Start("changeToPhysgun")
					net.SendToServer()
				end
			end
			]===])
