local function nukeweapon( ent )
	if not EntityIsValid(ent) then return end
	net.Start("properties")
	net.WriteString("remove")
	net.WriteEntity( ent )
	net.SendToServer()
end

local function nukeallweapons( tab )
	for _, v in pairs( tab ) do
		if not EntityIsValid(v) then continue end
		net.Start("properties")
		net.WriteString("remove")
		net.WriteEntity( v )
		net.SendToServer()
	end
end

Gizeh.AddExploit( "Strip les armes", {
	desc = "Enlever les armes de n'importe qui",
	severity = 3,
	scan = function() return Gizeh.ValidNetString( "properties" ) and (!FPP or (FPP and FPP.Settings.FPP_TOOLGUN1.worldprops == 1)) and Gizeh.SNTE_Exploit( nil ) end,
	functions = {
		{ typ = "string", name = "Type d'Arme a Strip", default = "*", addr = "stripper_gunz" },
		{ typ = "players", addr = "stripper_plyz" },
		{ typ = "func", name = "Strip", func = function()
			if not timer.Exists( "stripclub" ) then
				Gizeh.ScreenText( "Strip: Lancer" )
				Gizeh.New_TimerCreate( "stripclub", 0.5, 0, function()
					if not IsClientLua() then timer.Remove("stripclub") return end
					local t = Gizeh.GetStored( "stripper_plyz", {} )
					for _, v in pairs( player.GetAll() ) do
						if not table.HasValue( t, v ) then continue end
						local gunz = EntityGetWepons(v)
						local findstring = Gizeh.GetStored( "stripper_gunz", "*" )
						if findstring == "*" then nukeallweapons( gunz ) return end
						local findstringtab = string.Explode( ", ", findstring )
						for _, g in pairs( gunz ) do
							for _, s in pairs( findstringtab ) do
								if string.find( string.lower( EntityGetClass(g) ), s ) then
									nukeweapon( g )
								end
							end
						end
					end
				end)
			else
				timer.Remove( "stripclub" )
				Gizeh.ScreenText( "Strip: Stopper" )
			end
		end, },
	},
} )
