function Gizeh.OpenMenu()
	local size1, size2 = 768/1.1,456
	local MenuFrame = vgui.Create("DFrame");
	MenuFrame:SetSize(size2, size1);
	MenuFrame:Center();
	MenuFrame:SetTitle("");
	MenuFrame:SetPos(ScrW(),(ScrH()/2)-(size1/2))
	MenuFrame:MoveTo((ScrW()-size2),(ScrH()/2)-(size1/2), 0.1, 0, 0.5)
	MenuFrame:ShowCloseButton(false);
	MenuFrame:MakePopup()
	MenuFrame.Paint = function(self, w, h)
		surface.SetDrawColor( Color(47,49,50,250) )
		surface.DrawRect( 0, 0, w, h )
		surface.SetDrawColor( Color(40,40,40) )
		surface.DrawRect( 0, h-h/13, w, h/13 )
		Gizeh.OutlinedBox( 0, 0, w, h, 3, Gizeh.CheckforRainbow() )
		surface.SetDrawColor( Color(40,40,40) )
		surface.DrawRect( 0, 0, w, h/9 )
		Gizeh.OutlinedBox( 0, 0, w, h/9, 3, Gizeh.CheckforRainbow() )
		local font
		surface.SetFont("Gizeh_Title");
		local Width, Height = surface.GetTextSize(Gizeh.Visible[Gizeh.CurrentPanel].name)
		if Width > 500 then
			font = "Gizeh_Title_Very_Small"
		elseif Width > 300 then
			font = "Gizeh_Title_Small"
		else
			font = "Gizeh_Title"
		end
		surface.SetFont(font);
		surface.SetTextColor(177,177,177);
		local tw, th = surface.GetTextSize(Gizeh.Visible[Gizeh.CurrentPanel].name);
		surface.SetTextPos(w/2-(tw/2), ((h/9)/2)-(th/2));
		surface.DrawText(Gizeh.Visible[Gizeh.CurrentPanel].name);
	end
	MenuFrame.Think = function()
		if not IsClientLua() then 
			MenuFrame:Remove() 
			Gizeh.menuopen = false;
			MenuFrame = nil
			return 
		end
		if ( input.IsKeyDown(Gizeh.Config.OpenMenuKey) and !Gizeh.openmenukeydown2 ) then
			MenuFrame:MoveTo(ScrW(), (ScrH()/2)-(size1/2), 0.1, 0, 0.5, function()
				MenuFrame:Remove()
				Gizeh.menuopen = false;
				gui.HideGameUI()
			end)
		end
	end
	Gizeh.MenuPanel = MenuFrame
	for k,v in next, Gizeh.Order do
		local DermaButton = vgui.Create( "DButton", MenuFrame )
		DermaButton:SetSize(25,25)
		DermaButton:SetPos((MenuFrame:GetWide()/4)+(DermaButton:GetWide()*k)+5*k,MenuFrame:GetTall()-MenuFrame:GetTall()/17)
		DermaButton:SetText("")
		DermaButton.Paint = function( self, w, h )
			if Gizeh.Visible[v].state then
				Gizeh.RoundedBoxOutlined( 8, 0, 0, w, h, Color(177,177,177), Gizeh.Config.HoverColors, 1 )
			elseif DermaButton:IsHovered() then
				Gizeh.RoundedBoxOutlined( 8, 0, 0, w, h, Color(177,177,177), Gizeh.Config.HoverColors, 1 )
			else
				Gizeh.RoundedBoxOutlined( 8, 0, 0, w, h, Color(177,177,177), Gizeh.CheckforRainbow(), 1 )
			end
		end
		DermaButton.DoClick = function()
			Gizeh.SelectPanel(v)
			Gizeh.CreateThePanel(v,MenuFrame)
			Gizeh.CurrentPanel = v
		end
	end
	Gizeh.CreateThePanel(Gizeh.CurrentPanel,MenuFrame)
end
function Gizeh.CreateThePanel(Panel,MenuFrame)
	Gizeh.ChargerConfig()
	if Gizeh.DPanel and Gizeh.DPanel:IsVisible() then 
		Gizeh.DPanel:Remove()
	end
	Gizeh.DPanel = vgui.Create( "DPanel", MenuFrame)
	Gizeh.DPanel:SetPos( 3, MenuFrame:GetTall()/9 )
	Gizeh.DPanel:SetSize( MenuFrame:GetWide()-6, MenuFrame:GetTall()/1.22 )
	Gizeh.DPanel:SetPaintBackground( false )
	Gizeh.DefaultPanel(Panel,Gizeh.DPanel)
end
Gizeh.New_HookAdd("Think", "Gizeh_Think", function()
  if not IsClientLua() then Gizeh.RemoveHook("Think", "Gizeh_Think") return end
	local baseressource = math.Round( collectgarbage("count") )
	if ( input.IsKeyDown(Gizeh.Config.OpenMenuKey) and !Gizeh.menuopen and !Gizeh.openmenukeydown ) then
		gui.ActivateGameUI()
		Gizeh.menuopen = true
		Gizeh.openmenukeydown = true
		Gizeh.OpenMenu()
		Gizeh.ConsoleMsg2.FSize = 0
	elseif ( !input.IsKeyDown(Gizeh.Config.OpenMenuKey) and !Gizeh.menuopen ) then
		Gizeh.openmenukeydown = false
	end
	if ( input.IsKeyDown(Gizeh.Config.OpenMenuKey) and Gizeh.openmenukeydown and Gizeh.menuopen ) then
		gui.ActivateGameUI()
		Gizeh.openmenukeydown2 = true
		CloseDermaMenus()
	else
		Gizeh.openmenukeydown2 = false
	end
	Gizeh.MemoryDebug["Logic"] = math.Round( collectgarbage("count") ) - baseressource
end)

