		local function CreateBaxdoorPanel_Server( name, t )
		if not DPanel then return end
			local cmdp = vgui.Create( "DPanel" )
			cmdp:SetSize( Plist_Server:GetWide(), 70 )
			cmdp.Cmd = name
			cmdp.Desc = t.desc
			cmdp.Paint = function( s, w, h )
				Gizeh.RoundedBoxOutlined( 8, 0, 0, w, h, Color(56, 56, 56), Gizeh.CheckforRainbow(), 1 )
				Gizeh.RoundedBoxOutlined( 8, 0, 0, w, h/3, Color(36, 36, 36), Gizeh.CheckforRainbow(), 1 )
				surface.SetDrawColor( Color(36, 36, 36) )
				surface.DrawRect( 1, 12, w-2, h/6 )
				draw.DrawText( cmdp.Cmd, "DermaDefault", 10, 5, Color(177,177,177) )
				draw.DrawText( cmdp.Desc, "DermaDefault", 10, 24, Color(177,177,177) )
			end
			local x = 4
			for _, tab in ipairs( t.functions ) do
				if tab.typ == "func" then
					x = (x + 5) + Gizeh.MakeFunctionButton( cmdp, x, 42, tab.name, tab.func, Gizeh.CheckforRainbow() )
				elseif tab.typ == "players" then
					x = (x + 5) + Gizeh.MakePlayerSelectionButton( cmdp, x, 42, tab.addr )
				elseif tab.typ == "string" then
					x = (x + 5) + Gizeh.MakeTextInputButton( cmdp, x, 42, tab.default, tab.addr, Gizeh.CheckforRainbow() )
					if not Gizeh.IsStored( tab.addr ) then Gizeh.Store( tab.addr, tab.default ) end
				elseif tab.typ == "float" then
					x = (x + 5) + Gizeh.MakeNumberInputButton( cmdp, x, 42, tab.default, tab.min, tab.max, tab.addr, Gizeh.CheckforRainbow() )
					if not Gizeh.IsStored( tab.addr ) then Gizeh.Store( tab.addr, tab.default ) end
				end
			end
			cmdp:Dock( TOP )
			cmdp:DockMargin( 0, 0, 0, 5 )
			Plist_Server:AddItem( cmdp )
		end

