		function Gizeh.RetreivePlugins()
			if not IsValid(DlistV) then return end 
			DlistV:Clear()
			local files, directories = Gizeh.New_FileFind( "Gizeh_Plugins/*", "DATA" )
			for k,v in pairs(files) do
				DlistV:AddLine(string.StripExtension(v)..".lua")
			end
			for _, line in pairs( DlistV:GetLines() ) do
				function line:Paint( w, h )
					if line:GetValue( 1 ) == "autoexec.lua" then
						draw.RoundedBox(0, 0, 0, w, h, Gizeh.Config.HoverColors)
						return
					end
					if ( line:IsHovered() ) then
						draw.RoundedBox(0, 0, 0, w, h, Gizeh.Config.HoverColors)
					elseif ( line:IsSelected() ) then
						draw.RoundedBox(0, 0, 0, w, h, Gizeh.Config.HoverColors)
					else
						draw.RoundedBox(0, 0, 0, w, h, Color(35,35,35))
					end
				end
				for _, column in pairs( line["Columns"] ) do
					column:SetTextColor( Color(177,177,177) )
				end
			end
